import React, { Component } from "react";
import "../../styles/shopTool.scss"

export default class ShopTool extends Component {
    state = {
        moneyAmount: 10,
    }
  render() {
    return (
      <div className="shop">
        <div id="info-shop">
          <button className="amount-money">{this.state.moneyAmount}</button>
        </div>
        <div id="body-shop">
          <div id="small-pot-tool"></div>
          <div id="big-pot-tool"></div>
          <div id="water-tool"></div>
          <div id="scarecrow-tool"></div>
          <div id="small-pot"></div>
        </div>
      </div>
    );
  }
}
